export class Coffee {
  id: number;
  name: string;
  type: string;
  region: string;
  taste: string;
  altitude: number;
  image: string;

  constructor(id: number, name: string, type: string, region: string, taste: string, altitude: number, image: string) {
    this.id = id;
    this.name = name;
    this.type = type;
    this.region = region;
    this.taste = taste;
    this.altitude = altitude;
    this.image = image;
  }
}
